import React from "react";
import "owl.carousel/dist/assets/owl.carousel.css";
import "owl.carousel/dist/assets/owl.theme.default.css";
import "./assets/css/RollingCarousel.css";
import OwlCarousel from "react-owl-carousel";
import img from "./assets/img/image.png";
import CarouselProduct from "./CarouselProduct";
function RollingCarousel() {
  return (
    <div>
      <section className="ftco-section">
        <div className="container">
          <div className="row">
            <div className="col-md-12 text-center">
              <h2 className="heading-section mb-5 pb-md-4">Welcome Guest</h2>
            </div>
            <div className="col-md-12">
              <OwlCarousel
                classNameName="owl-theme m-4"
                loop
                margin={10}
                nav
                loop={true}
                autoplay={true}
                margin={30}
                animateOut="fadeOut"
                animateIn="fadeIn"
                nav={true}
                dots={true}
                autoplayHoverPause={false}
                items={1}
                navText={[
                  "<span className='ion-ios-arrow-back'></span>",
                  "<FontAwesomeIcon icon='fa-light fa-angle-right' />",
                ]}
                responsive={{
                  0: {
                    items: 1,
                  },
                  600: {
                    items: 2,
                  },
                  1000: {
                    items: 3,
                  },
                }}
              >
                <div className="item">
                  <div className="work">
                    <div
                      className="img d-flex align-items-center justify-content-center rounded"
                      style={{ backgroundImage: `url(${img})` }}
                    >
                      <a
                        href="#"
                        className="icon d-flex align-items-center justify-content-center"
                      >
                        <span className="ion-ios-search"></span>
                      </a>
                    </div>
                    <div className="text pt-3 w-100 text-center">
                      <h3>
                        <a href="#">Work 06</a>
                      </h3>
                      <span>Web Design</span>
                    </div>
                  </div>
                </div>
                <CarouselProduct />
              </OwlCarousel>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default RollingCarousel;
